import React from "react";
import "../DashboardFuncionario.css";

export default function DashboardFuncionario() {
  const funcionario = {
    nombre: "Juan Pérez",
    email: "juan.perez@eleam.chile.cl",
    tipo: "Auxiliar",
    turno: "Mañana",
    horaIngreso: "08:00",
  };

  return (
    <div className="dashboard-container">
      {/* Banner */}
      <div className="banner">
        <div className="logo"></div>
        <div className="red-eleam">Red ELEAM</div>
        <div className="portal-eleam">Portal ELEAM</div>
      </div>

      {/* Datos Funcionario */}
      <div className="datos-funcionario">
        <div className="foto-funcionario"></div>
        <div className="info-funcionario">
          <p>Nombre: {funcionario.nombre}</p>
          <p>Email: {funcionario.email}</p>
          <p>Tipo: {funcionario.tipo}</p>
          <p>Turno: {funcionario.turno}</p>
          <p>Hora de ingreso: {funcionario.horaIngreso} hrs</p>
        </div>
      </div>

      {/* Botones */}
      <div className="botones-dashboard">
        <button className="btn-dashboard">Ingresar Formulario</button>
        <button className="btn-dashboard">Consultar Formulario</button>
        <button className="btn-dashboard">Cerrar Sesión</button>
      </div>

      {/* Formulario */}
      <div className="formulario-turno">
        <h2>Formulario Turno Anterior</h2>
        {/* Aquí puedes añadir inputs o tabla */}
      </div>
    </div>
  );
}
